import { Card, Button } from 'react-bootstrap';
//import { userContext } from '../userContext';
import React from 'react';
import "./home.css";

function Home(){

    const handleSubmit = (e) => {
        console.log("logged out");
        window.onunload = function() {
            sessionStorage.removeItem('key');
         }
        window.location.reload()
    }

    return (

        <Card className="bg-dark text-white" border="light" >
            <Card.Img src="./bank.jpg" alt="Banking image" />
            <Card.ImgOverlay>
                <Card.Title className="title">Welcome To BadBank</Card.Title>
                <Card.Text className="text">
                    Thank you for trusting us with your banking needs!
                </Card.Text>
                <div className="user-home">
                    <Card.Text>
                        Username: User
                    </Card.Text>
                    <Card.Text> 
                        Account Type: Checking
                    </Card.Text>
                    <Card.Text>
                        Balance: $100
                    </Card.Text>
                </div>
                <div className="log-out-button">
                    <Button as="input" type="submit" onClick={handleSubmit} value="Log Out"/>
                </div>
            </Card.ImgOverlay>
        </Card>

    );
}

export default Home;
